INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES ("それならプリンがいいの～！\nこのケーキと同じくらい、でっかい\nプリンが食べたいの～！", 11, 31114, 10, 100711, 0.5, 31114076, 0, 0, 1, 1);
